import React from "react";
import { Typography } from "@material-ui/core";
import Plan from "../images/code.svg";
export default function Market() {
  return (
    <div>
      <img
        alt="random"
        src={Plan}
        style={{
          marginBottom: "-30px",
          paddingTop: "3rem",
          maxWidth: "100%",
          height: "auto"
        }}
      />
    </div>
  );
}
